  false,\n\t\"url\": null,\n\t\"notes\": \"This data has been acquired and developed
  by the National Guard Bureau (NGB) to collect and deliver topographic elevation
  point data derived from multiple return light detection and ranging (LiDAR) measurements
  for the 31 sq. mile project area encompassing Camp Grafton, North Dakota. Fugro
  EarthData, Inc. acquired 36 flight lines in 1 lift on December 5, 2012. LiDAR data
  collection was performed with a Cessna 310 twin engine aircraft, utilizing a Leica
  ALS60 MPiA sensor; collecting multiple return x, y, and z as well as intensity data.
  The classified LiDAR point cloud data are delivered in LAS 1.3 format: 1 u2013 unclassified,
  2 u2013 ground, 3 u2013 low vegetation, 5 u2013 high vegetation, 6 u2013 buildings,
  7 u2013 low points, 8 u2013 model keypoints, 9 u2013 water, and 10 u2013 reserved,
  12 u2013 overlap points. Specialized in-house and commercial software processes
  the native LiDAR data into 3-dimensional positions that can be imported into GIS
  software for visualization and further analysis. The horizontal datum for the data
  is geographic Coordinates, NAD83(2011) in meters and the vertical datum is the North
  American Vertical Datum of 1988 (NAVD88) in meters using GEIOD12A.\",\n\t\"license_title\":
